import React from "react";

export const CharactersPrint = (props) => {
  return (
    <>
      <div>
        <img src={props.characters.image} alt="person" />
        <div>
          <p>Name: {props.characters.name}</p>
          <p>Species: {props.characters.species}</p>
        </div>
      </div>
    </>
  );
};
